import React, {useState} from 'react';

const OrderDetail= ({ord}) => {

    const [search, setSearch] = useState("");

    /*
    const [customer_id, setCustomerId] = useState(ord.customer_id);
    const [date, setDate] = useState(ord.date);
    const [status, setStatus] = useState(ord.status);
    const [total, setTotal] = useState(ord.total);
    */

    const setData = async (e) => {
        e.preventDefault();
        try {
            const body = "";
            //const body = {customer_id, date, status, total};
            //console.log(body);
            const options = {
                method: 'PUT',
                headers: {"Content-Type":"application/json"},
                body: JSON.stringify(body)
            };
            const response = await fetch(`http://localhost:3001/orders/api/v1/ord/${String(ord.id)}`, options);
            console.log(response);
            // temporary solution for refresh page
            window.location.reload();
        } catch (error) {

        }

    }

    return (
        <>
            <div className="container" style={{color: "black"}} >

                <button type="button" className="btn btn-info" data-toggle="modal" data-target="#myModal">
                    Items
                </button>

                <div className="modal fade" id="myModal">
                    <div className="modal-dialog modal-lg">
                    <div className="modal-content">


                        <div className="modal-header">
                        <h4 className="modal-title">Order Items</h4>
                        <button type="button" className="close" data-dismiss="modal">&times;</button>
                        </div>


                        <div className="modal-body">
                            <table className="table table-bordered">
                            <thead>
                                <tr>
                                    <th>Product</th>
                                    <th>Quantity</th>
                                    <th>Unit Price</th>
                                    <th>Subtotal</th>
                                </tr>
                                </thead>
                                <tbody>
                                <tr>
                                    <td>Coca-cola 2L</td>
                                    <td>10</td>
                                    <td>7.50</td>
                                    <td>75.00</td>
                                </tr>

                            </tbody>
                            </table>
                        </div>

                        <div className="modal-body">
                            <h5 className="modal-title">Edit Quantity</h5>
                            <table className="table">
                                <thead>
                                <tr>
                                    <th>Product</th>
                                    <th>Quantity</th>
                                    <th>Unit Price</th>
                                    <th>Subtotal</th>
                                </tr>
                                </thead>
                                <tbody>
                                <tr>
                                    <td>Pepsi-cola 2L</td>
                                    <td><input type="number" min="0" step="1" className="form-control w-25" onChange={()=>{}} id="amountInput"/></td>
                                    <td>6.00</td>
                                    <td>30.00</td>
                                </tr>
                                </tbody>
                            </table>
                        </div>


                        <div className="modal-footer">
                            <div className="container">
                                <div className="input-group col-md-4 m-3">
                                        <input className="form-control py-2 border-right-0 border" type="search" placeholder="search" onChange={e=>{setSearch(e.target.value)}} id="example-search-input"/>
                                        <span className="input-group-append">
                                            <button className="btn btn-outline-secondary border-left-0 border" type="button">
                                                <i className="fa fa-search"></i>
                                            </button>
                                        </span>
                                </div> 
                                <button type="button" className="btn btn-success" data-dismiss="modal">Ok</button>
                                <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                            </div>

                        </div>

                    </div>
                    </div>
                </div>

            </div>


        </>

    );

};

export default OrderDetail;
